script: |
  super -f text -I q689.spq | sort > q689.out

inputs:
  - name: q689.spq
    data: |
      SELECT a+b*2+c*3+d*4+e*5,
      e
      FROM t1 (FORMAT parquet)
      WHERE (e>a AND e<b)
      AND (e>c OR e<d);
  - name: t1

outputs:
  - name: q689.out
    data: |
      3331	221
      3706	246
